import React, { Component } from 'react'


export class Navbar extends Component {

    static defaultProps = {
        title : "Github-finder" ,
        icon : "fas fa-github"


    }

    render() {
        return (
          <nav className="navbar bg-primary">
             <h1> 
             <i classname = {this.props.icon}></i> {this.props.title} 
                 </h1>
              </nav>
        )
    }
}

export default Navbar
